import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';
import Login from './pages/Login';
import Signup from './pages/Signup';
import Contact from './components/Contact';
import Cart from './pages/Cart';
import Footer from './components/Footer';
import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";
import Product from './components/Product';
 const Womencategories = [
    {
      name: "Tshirt",
      image:
        "https://sp.yimg.com/ib/th?id=OPAC.t0Vf3%2f1yQBB8Ng474C474&o=5&pid=21.1&w=174&h=174",
      link: "Tshirt",
    },
    {
      name: "Shirt",
      image:
        "https://media.everlane.com/image/upload/c_scale,dpr_1.5,f_auto,q_auto,w_auto/v1/i/287f132e_2c66.jpg",
      link: "Shirt",
    },
    {
      name: "Pant",
      image:
        "https://media.everlane.com/image/upload/c_scale,dpr_1.5,f_auto,q_auto,w_auto/v1/i/287f132e_2c66.jpg",
      link: "Pant",
    },
    {
      name: "Sweater",
      image:
        "https://media.everlane.com/image/upload/c_scale,dpr_1.5,f_auto,q_auto,w_auto/v1/i/287f132e_2c66.jpg",
      link: "Sweater",
    },
  ];
function App() {
  return (
    <Router >
      <Navbar/>
    <Product></Product>
      <Routes>
  <Route exact path="/women" element={<Signup categories={Womencategories}></Signup>}></Route>
      <Route exact path="/signup" element={<Signup></Signup>}></Route>
         <Route exact path="/login" element={<Login></Login>}></Route>

    </Routes>
    </Router>
  );
}

export default App;
